&lt;p&gt;Ю́рий prit une profonde inspiration qui se perdit aussitôt dans des mouvements giratoires chaotiques. Chaussette orpheline ballotée par le tambour éructant d’une machine à laver partiellement ivre. Son cerveau sentit Ю́рий dégouliner, et bizarrement cela sentait bon. &lt;/p&gt;
&lt;p&gt;
« Premier cas de collision spontanée » titra la Dépêche du Midi.
&lt;/p&gt;

